import React from 'react';
import { ParallaxProvider, Parallax } from '@react-scroll-parallax';
import Nbar from '../NavxFooter/NavBar';
import PresentationWeb from './Pres';
import SecSectionP from './SecSectionP';
import Foo from '../NavxFooter/Footer';
import TsectionP from './TsectionP';

const PageF1 = () => {
  return (
    <ParallaxProvider>
      <div className="bg-white dark:bg-black">
        <Nbar />

        <Parallax y={[-20, 20]} tagOuter="div">
          <PresentationWeb />
        </Parallax>

        <Parallax y={[-40, 40]} tagOuter="div">
          <SecSectionP />
        </Parallax>

        <Parallax y={[-60, 60]} tagOuter="div">
          <TsectionP />
        </Parallax>

        <Parallax y={[-80, 80]} tagOuter="div">
          <Foo />
        </Parallax>
      </div>
    </ParallaxProvider>
  );
};

export default PageF1;
